<html>
  <head>
    <title>pakenprax</title>
	<meta charset="utf-8" />
        <link rel="canonical" href="https://pakenprax.com{{ page.url }}" />
        <script type="text/javascript">
        var host = "pakenprax.com";
        var github = "pakenprax.github.io/pakenprax.com";
        var url = window.location.toString();
        if (url.indexOf(github) > -1) window.location = url.replace(github, host);
        if ((host == window.location.host) && (window.location.protocol != "https:")) window.location.protocol = "https";
        </script>
  </head>
  <body>
    <h1>pakenprax.com</h1>
  </body>
</html>
